import './Standings.css';
import Table from './Table';

const Standings = ({ team, }) => {
  const positions = [];
  positions.push(team);

  return (
    <section>
      {positions.map((position, key) => <div>position.table</div>)}
    </section>
  )
};

export default Standings;
